<!-- This is the "empty" wick player - it doesn't do anything 
     unless the editor bundles a project inside of it.  -->

<head>
    <style>
        /* remove the top and left whitespace */
    	* { margin:0; padding:0; }

        /* just to be sure these are full screen */
    	html, body { width:100%; height:100%; background-color: #DDDDDD; }

        /* To remove the scrollbars */
    	canvas { display:block; }
    </style>
</head>

<body>
    <!-- contenteditable="true" and tabindex="1" should make the canvas fire off key events. -->
	<div id="playerCanvasContainer" contenteditable="true" tabindex="1"></div>
</body>

<script>// Framerate keeper 
// http://www.html5gamedevs.com/topic/1828-how-to-calculate-fps-in-plain-javascript/
var fps = { startTime : 0,
	frameNumber : 0,
	getFPS : function() {
		this.frameNumber++;

		var d = new Date().getTime();
		var currentTime = ( d - this.startTime ) / 1000;
		var result = Math.floor( ( this.frameNumber / currentTime ) );

		if( currentTime > 1 ) {
			this.startTime = new Date().getTime();
			this.frameNumber = 0;
		}

		return result;
	}   
};</script>

<script>/* lil input checker by Josh */

var CheckInput = (function () {

    var checkInput = { };

    checkInput.isNumber = function (n) {
        var num = parseInt(n);
        return (typeof num === 'number') && !isNaN(num);
    }

    checkInput.isInteger = function (n) {
        var num = parseInt(n);
        return (typeof num === 'number') && (num % 1 == 0);
    }

	checkInput.isPositiveInteger = function (n) {
        var num = parseInt(n);
        return (typeof num === 'number') && (num % 1 == 0) && (num > 0)
    }

    checkInput.isString = function (str) {
        return typeof str === 'string';
    }

    checkInput.testPositiveInteger = function (n) {
        var num = parseInt(n);
        return ((typeof num === 'number') && (num % 1 == 0) && (num > 0));
    }

    checkInput.isNonNegativeInteger = function (n) {
        var num = parseInt(n);
        return ((typeof num === 'number') && (num % 1 == 0) && (num >= 0));
    }

	return checkInput;

})();</script>
<script>/* Wick - (c) 2016 Zach Rispoli, Luca Damasco, and Josh Rispoli */

var WickFrame = function () {
	// Identifier so we can do e.g. gotoAndStop("menu") 
	this.identifier = null;

	// Store all objects in frame. 
	this.wickObjects = [];

	// Create multiframe support. 
	this.frameLength = 1;

	// Should we stop when we get to this frame?
	this.autoplay = true;
};

// Extend our frame to encompass more frames. 
WickFrame.prototype.extend = function(length) {
	this.frameLength += length; 
}

// Reduce the number of frames this WickFrame Occupies. 
WickFrame.prototype.shrink = function(length) {
	// Never "shrink" by a negative amount. 
	if (length <= 0) {
		return;
	}

	originalLength = this.frameLength; 
	this.frameLength -= length; 

	// determine and return the actual change in frames. 
	if (this.frameLength <= 0) {
		this.frameLength = 1;
		return originalLength - 1; 
	} else {
		return length; 
	}
}

WickFrame.prototype.copy = function () {

	var copiedFrame = new WickFrame();

	copiedFrame.identifier = this.identifier;
	copiedFrame.frameLength = this.frameLength;
	copiedFrame.autoplay = this.autoplay;

	this.wickObjects.forEach(function (wickObject) {
		copiedFrame.wickObjects.push(wickObject.copy());
	})

	return copiedFrame;

}

<script>/* Wick - (c) 2016 Zach Rispoli, Luca Damasco, and Josh Rispoli */

var WickLayer = function () {
	this.frames = [new WickFrame()];
};

WickLayer.prototype.getTotalLength = function () {
	var length = 0;

	for(var i = 0; i < this.frames.length; i++) {
		length += this.frames[i].frameLength;
	}

	return length;
}

WickLayer.prototype.addFrame = function(newFrame) {
    this.frames.push(newFrame);
}

WickLayer.prototype.deleteFrame = function(frame) {
    this.frames.splice(this.frames.indexOf(frame), 1);
}

WickLayer.prototype.copy = function () {

	var copiedLayer = new WickLayer();
	copiedLayer.frames = [];

	this.frames.forEach(function (frame) {
		copiedLayer.frames.push(frame.copy());
	})

	return copiedLayer;

}</script>

var WickObject = function () {

    // Unique ID. Must never change after object is first created.
    this.id = null;

    this.name = undefined;

    this.x = 0;
    this.y = 0;
    this.width = undefined;
    this.height = undefined;
    this.scaleX = 1;
    this.scaleY = 1;
    this.angle = 0;
    this.flipX = false;
    this.flipY = false;
    this.opacity = 1;

    this.tweens = [];

    // Dictionary mapping function names to WickScript object
    this.wickScripts = {
        "onLoad" : "// Setup\n// This script runs once when this object enters the scene.\n",
        "onClick" : "// On Click\n// This script runs when this object is clicked on.\n",
        "onUpdate": "// Update\n// This script runs repeatedly whenever this object is in the scene.\n",
        "onKeyDown": "// On Key Pressed\n// This script runs whenever a key is pressed.\n"
    };

// Static

    // Data, only used by static objects
    this.imageData = undefined;
    this.fontData  = undefined;
    this.svgData   = undefined;

// Symbols

    // See design docs for how objects and symbols work.
    this.isSymbol = false;

    // Used to keep track of what frame is being edited
    this.playheadPosition = null;
    this.currentLayer = null;

    // List of layers, only used by symbols
    this.layers = undefined;

};

WickObject.fromJSON = function (jsonString) {
    // Parse JSON
    var newWickObject = JSON.parse(jsonString);

    // Put prototypes back on object ('class methods'), they don't get JSONified on project export.
    WickObject.addPrototypes(newWickObject);

    // Decode scripts back to human-readble and eval()-able format
    newWickObject.decodeStrings();

    return newWickObject;
}

WickObject.fromJSONArray = function (jsonArrayObject, callback) {
    var newWickObjects = [];

    var wickObjectJSONArray = jsonArrayObject.wickObjectArray;
    for (var i = 0; i < wickObjectJSONArray.length; i++) {
        
        var newWickObject = WickObject.fromJSON(wickObjectJSONArray[i]);
        
        if(wickObjectJSONArray.length > 1) {
            newWickObject.x += jsonArrayObject.groupPosition.x;
            newWickObject.y += jsonArrayObject.groupPosition.y;
        }

        newWickObjects.push(newWickObject);
    }

    callback(newWickObjects);
}

    var fileImage = new Image();

        var obj = new WickObject();

        obj.width = fileImage.width;
        obj.height = fileImage.height;
        obj.imageData = fileImage.src;

        callback(obj);
    }

        symbol.layers[0].frames[0].wickObjects[i].y = wickObjects[i].y - symbol.y;
    }

    symbol.width  = symbol.layers[0].frames[0].wickObjects[0].width;
    symbol.height = symbol.layers[0].frames[0].wickObjects[0].height;

    // Adjust symbol position and children positions such that the origin of the symbol is the top-left corner of the symbol

    var corner = symbol.getSymbolCornerPosition();

    symbol.layers[0].frames[0].wickObjects.forEach(function (obj) {
        obj.x -= corner.x;
        obj.y -= corner.y;
    });

    symbol.x += corner.x;
    symbol.y += corner.y;

    return symbol;

}

/*************************
     Timeline Control
*************************/

WickObject.prototype.getCurrentFrame = function() {
    return this.getFrameAtPlayheadPosition(this.playheadPosition);
}

WickObject.prototype.getCurrentLayer = function() {
    return this.layers[this.currentLayer];
}

WickObject.prototype.addLayer = function (layer) {
    this.layers.push(layer);
}

WickObject.prototype.removeLayer = function (layer) {
    var that = this;
    this.layers.forEach(function (currLayer) {
        if(layer === currLayer) {
            that.layers.splice(that.layers.indexOf(layer), 1);
        }
    });
}

WickObject.prototype.getFrameByIdentifier = function (id) {

    var foundFrame = null;

    this.layers.forEach(function (layer) {
        layer.frames.forEach(function (frame) {
            if(frame.identifier === id) {
                foundFrame = frame;
            }
        });
    });

    return foundFrame;

}

// If the frame's length > 1, always return the playhead position of at the frame's beginning
WickObject.prototype.getPlayheadPositionAtFrame = function (frame) {

    var playheadPositionAtFrame = null;
    var frameCounter = 0;

    this.layers.forEach(function (l) {
        frameCounter = 0;
        l.frames.forEach(function (f) {
            if(f === frame) {
                playheadPositionAtFrame = frameCounter;
            }
            frameCounter += f.frameLength;
        });
    });

    return playheadPositionAtFrame;

}

WickObject.prototype.getRelativePlayheadPosition = function (wickObj, args) {
    var frame = this.getFrameWithChild(wickObj);
    var frameStartPlayheadPosition = this.getPlayheadPositionAtFrame(frame);
    var playheadRelativePosition = this.playheadPosition - frameStartPlayheadPosition;

    if(args && args.normalized) playheadRelativePosition /= frame.frameLength-1;

    return playheadRelativePosition;
}

WickObject.prototype.getFrameAtPlayheadPosition = function(pos, layerToSearch) {
    var layer = layerToSearch || this.getCurrentLayer();
    var counter = 0;

    for(var f = 0; f < layer.frames.length; f++) {
        var frame = layer.frames[f];
        for(var i = 0; i < frame.frameLength; i++) {
            if(counter == pos) {
                return frame;
            }
            counter++;
        }
    }

    // Playhead isn't over a frame on the current layer.
    return null;
}

WickObject.prototype.getTotalTimelineLength = function () {
    var longestLayerLength = 0;

    this.layers.forEach(function (layer) {
        var layerLength = layer.getTotalLength();
        if(layerLength > longestLayerLength) {
            longestLayerLength = layerLength;
        }
    });

    return longestLayerLength;

}

/*************************
     Children utils
*************************/

/* Return all child objects of a parent object (and their children) */
WickObject.prototype.getAllChildObjectsRecursive = function () {

    if (!this.isSymbol) {
        return []; 
    }

    var children = [];
    for(var l = this.layers.length-1; l >= 0; l--) {
        var layer = this.layers[l];
        for(var f = 0; f < layer.frames.length; f++) {
            var frame = layer.frames[f];
            for(var o = 0; o < frame.wickObjects.length; o++) {
                children.push(frame.wickObjects[o]);
                children = children.concat(frame.wickObjects[o].getAllChildObjectsRecursive());
            }
        }
    }
    return children;
}

/* Return all child objects of a parent object */
WickObject.prototype.getAllChildObjects = function () {

    if (!this.isSymbol) {
        return []; 
    }

    var children = [];
    for(var l = this.layers.length-1; l >= 0; l--) {
        var layer = this.layers[l];
        for(var f = 0; f < layer.frames.length; f++) {
            var frame = layer.frames[f];
            for(var o = 0; o < frame.wickObjects.length; o++) {
                children.push(frame.wickObjects[o]);
            }
        }
    }
    return children;
}

/* Return all child objects in the parent objects current frame. */
WickObject.prototype.getAllActiveChildObjects = function () {

    if (!this.isSymbol) {
        return []; 
    }

    var children = [];
    for (var l = this.layers.length-1; l >= 0; l--) {
        var frame = this.getFrameAtPlayheadPosition(this.playheadPosition, this.layers[l]);
        if(frame) {
            frame.wickObjects.forEach(function (obj) {
                children.push(obj);
            });
        }
    }
    return children; 
}

/* Return all child objects in the parent objects current layer. */
WickObject.prototype.getAllActiveLayerChildObjects = function () {

    if (!this.isSymbol) {
        return []; 
    }

    var children = [];
    var layer = this.getCurrentLayer();
    var frame = this.getFrameAtPlayheadPosition(this.playheadPosition, layer);
    if(frame) {
        frame.wickObjects.forEach(function (obj) {
            children.push(obj);
        });
    }
    return children; 
}

// Use this to render unselectable objects in Fabric
WickObject.prototype.getAllInactiveSiblings = function () {

    if(!this.parentObject) {
        return [];
    }

    var that = this;
    var siblings = [];
    this.parentObject.getAllActiveChildObjects().forEach(function (child) {
        if(child.id !== that.id) {
            siblings.push(child);
        }
    });
    siblings = siblings.concat(this.parentObject.getAllInactiveSiblings());

    return siblings;

}

// Use this for onion skinning
WickObject.prototype.getNearbyObjects = function (numFramesBack, numFramesForward) {

    // Get nearby frames

    var nearbyFrames = [];

    var startPlayheadPosition = Math.max(0, this.playheadPosition - numFramesBack);
    var endPlayheadPosition = this.playheadPosition + numFramesForward;
    var tempPlayheadPosition = startPlayheadPosition;

    while(tempPlayheadPosition <= endPlayheadPosition) {
        var frame = this.getFrameAtPlayheadPosition(tempPlayheadPosition);

        if(frame && tempPlayheadPosition !== this.playheadPosition && nearbyFrames.indexOf(frame) == -1) {
            nearbyFrames.push(frame);
        }
        
        tempPlayheadPosition ++;
    }

    // Get objects in nearby frames

    var nearbyObjects = [];

    nearbyFrames.forEach(function(frame) {
        nearbyObjects = nearbyObjects.concat(frame.wickObjects);
    });

    return nearbyObjects;

}

//
WickObject.prototype.getObjectsOnFirstFrame = function () {

    var objectsOnFirstFrame = [];

    this.layers.forEach(function (layer) {
        layer.frames[0].wickObjects.forEach(function (wickObj) {
            objectsOnFirstFrame.push(wickObj);
        });
    });

    return objectsOnFirstFrame;

}

/* Excludes children of children */
WickObject.prototype.getTotalNumChildren = function () {
    var count = 0;
    for(var l = 0; l < this.layers.length; l++) {
        for(var f = 0; f < this.layers[l].frames.length; f++) {
            for(var o = 0; o < this.layers[l].frames[f].wickObjects.length; o++) {
                count++;
            }
        }
    }
    return count;
}

WickObject.prototype.getChildByID = function (id) {

    if(!this.isSymbol) {
        if(this.id == id) {
            return this;
        } else {
            return null;
        }
    }

    if(this.isSymbol) {
        if(this.id == id) {
            return this;
        }
    }

    var foundChild = null;

    this.getAllChildObjects().forEach(function(child) {
        if(child.id == id) {
            if(!foundChild) foundChild = child;
        } else {
            if(!foundChild) foundChild = child.getChildByID(id);
        }
    }); 

    return foundChild;
}

WickObject.prototype.getFrameWithChild = function (child) {

    var foundFrame = null;

    this.layers.forEach(function (layer) {
        layer.frames.forEach(function (frame) {
            if(frame.wickObjects.indexOf(child) !== -1) {
                foundFrame = frame;
            }
        });
    });

    return foundFrame;
}

WickObject.prototype.getLayerWithChild = function (child) {

    var foundLayer = null;

    this.layers.forEach(function (layer) {
        layer.frames.forEach(function (frame) {
            if(frame.wickObjects.indexOf(child) !== -1) {
                foundLayer = layer;
            }
        });
    });

    return foundLayer;
}

WickObject.prototype.removeChildByID = function (id) {

    if(!this.isSymbol) {
        return;
    }

    var that = this;
    this.getAllActiveChildObjects().forEach(function(child) {
        if(child.id == id) {
            var index = that.getCurrentFrame().wickObjects.indexOf(child);
            that.getCurrentFrame().wickObjects.splice(index, 1);
        }
        child.removeChildByID(id);
    }); 
}

/* Used to generate a unique ID for new WickObjects */
WickObject.prototype.getLargestID = function (id) {
    if(!this.isSymbol) {
        return this.id;
    }

    var largestID = 0;

    if(this.id > largestID) {
        largestID = this.id;
    }
    this.getAllChildObjects().forEach(function(child) {
        var subLargestID = child.getLargestID();

        if(subLargestID > largestID) {
            largestID = subLargestID;
        }
    }); 

    return largestID;
}

/*************************
     Positioning stuff
*************************/

/*  */
WickObject.prototype.getBoundingBoxPoints = function () {
    // http://stackoverflow.com/questions/17410809/how-to-calculate-rotation-in-2d-in-javascript
    function rotate(centerPoint, pointToRotate, angle) {
        var radians = (Math.PI / 180) * angle,
            cos = Math.cos(radians),
            sin = Math.sin(radians),
            nx = (cos * (pointToRotate.x - centerPoint.x)) + (sin * (pointToRotate.y - centerPoint.y)) + centerPoint.x,
            ny = (cos * (pointToRotate.y - centerPoint.y)) - (sin * (pointToRotate.x - centerPoint.x)) + centerPoint.y;
        return {x:nx, y:ny};
    }

    var points = {
        topLeftPoint     : { x : this.x,              y : this.y               },
        topRightPoint    : { x : this.x + this.width, y : this.y               },
        bottomLeftPoint  : { x : this.x,              y : this.y + this.height },
        bottomRightPoint : { x : this.x + this.width, y : this.y + this.height },
    };

    var origin = {x:points.topLeftPoint.x, y:points.topLeftPoint.y};

    points.topLeftPoint     = rotate(origin, points.topLeftPoint, -this.angle);
    points.topRightPoint    = rotate(origin, points.topRightPoint, -this.angle);
    points.bottomRightPoint = rotate(origin, points.bottomRightPoint, -this.angle);
    points.bottomLeftPoint  = rotate(origin, points.bottomLeftPoint, -this.angle);

    return points;

}

/*  */
WickObject.prototype.getBoundingBoxCorner = function () {
    
    var boundingBoxPoints = this.getBoundingBoxPoints();
    var allPointsX = [
        boundingBoxPoints.topLeftPoint.x,
        boundingBoxPoints.topRightPoint.x,
        boundingBoxPoints.bottomLeftPoint.x,
        boundingBoxPoints.bottomRightPoint.x
    ].sort(function (a, b) { return a-b; });
    var allPointsY = [
        boundingBoxPoints.topLeftPoint.y,
        boundingBoxPoints.topRightPoint.y,
        boundingBoxPoints.bottomLeftPoint.y,
        boundingBoxPoints.bottomRightPoint.y
    ].sort(function (a, b) { return a-b; });

    return {x:allPointsX[0],y:allPointsY[0]};

}

/*  */
WickObject.prototype.getSymbolBoundingBoxCorner = function () {

    if(!this.isSymbol) return this.getBoundingBoxCorner();

    var allBoundingBoxCornersX = [];
    var allBoundingBoxCornersY = [];

    this.getObjectsOnFirstFrame().forEach(function (child) {
        var bboxCorner = child.getSymbolBoundingBoxCorner();
        allBoundingBoxCornersX.push(bboxCorner.x);
        allBoundingBoxCornersY.push(bboxCorner.y);
    });

    allBoundingBoxCornersX.sort(function (a, b) { return a-b; });
    allBoundingBoxCornersY.sort(function (a, b) { return a-b; });

    return {x:allBoundingBoxCornersX[0], y:allBoundingBoxCornersY[0]};

}

/* Used to properly position symbols in fabric */
WickObject.prototype.getSymbolCornerPosition = function () {

    if(!this.isSymbol) {
        return {x:0, y:0};
    }

    var leftmostLeft = null;
    var topmostTop = null;

    this.getObjectsOnFirstFrame().forEach(function (child) {
        var checkX, checkY;

        if(child.isSymbol) {
            var symCorner = child.getSymbolCornerPosition();
            checkX = child.x+symCorner.x;
            checkY = child.y+symCorner.y;
        } else {
            checkX = child.x;
            checkY = child.y;
        }

        if(leftmostLeft === null || checkX < leftmostLeft) {
            leftmostLeft = checkX;
        }

        if(topmostTop === null || checkY < topmostTop) {
            topmostTop = checkY;
        }
    });

    return {x:leftmostLeft, y:topmostTop};

}

// used as a hack to get around fabric.js lack of rotation around anchorpoint
WickObject.prototype.fixOriginPoint = function () {
    var symbolCornerPosition = this.getSymbolCornerPosition();
    this.getAllChildObjects().forEach(function (child) {
        child.x -= symbolCornerPosition.x;
        child.y -= symbolCornerPosition.y;
    });
    this.x += symbolCornerPosition.x;
    this.y += symbolCornerPosition.y;
}

/* Get the absolute position of this object (i.e., the position not relative to the parents) */
WickObject.prototype.getAbsolutePosition = function () {
    if(this.isRoot) {
        return {
            x: 0, 
            y: 0
        };
    } else {
        var parentPosition = this.parentObject.getAbsolutePosition();
        return {
            x: this.x + parentPosition.x, 
            y: this.y + parentPosition.y
        };
    }
}

WickObject.prototype.isOnActiveLayer = function () {

    return this.parentObject.getLayerWithChild(this) === this.parentObject.getCurrentLayer();

}

/*************************
     Export
*************************/

WickObject.prototype.getAsJSON = function () {
    var oldX = this.x;
    var oldY = this.y;
    var absPos = this.getAbsolutePosition();
    this.x = absPos.x;
    this.y = absPos.y;

    // Encode scripts to avoid JSON format problems
    this.encodeStrings();

    var JSONWickObject = JSON.stringify(this, WickProjectExporter.JSONReplacer);

    // Put prototypes back on object ('class methods'), they don't get JSONified on project export.
    WickObject.addPrototypes(this);

    // Decode scripts back to human-readble and eval()-able format
    this.decodeStrings();

    this.x = oldY;
    this.x = oldX;

    return JSONWickObject;
}

WickObject.prototype.getAsFile = function () {

    if(this.isSymbol) {
        console.log("note: we don't have wickobject import yet.")
        return this.getAsJSON();
    }

    if(this.imageData) {

    }

    console.error("export not supported for this type of wickobject yet");

}

WickObject.addPrototypes = function (obj) {

    // Put the prototype back on this object
    obj.__proto__ = WickObject.prototype;

    // Recursively put the prototypes back on the children objects
    if(obj.isSymbol) {
        obj.layers.forEach(function (layer) {
            layer.__proto__ = WickLayer.prototype;
            layer.frames.forEach(function(frame) {
                frame.__proto__ = WickFrame.prototype;
            });
        });
        if(obj.tweens) { // Rescues old projects created before tweens came out
            obj.tweens.forEach(function (tween) {
                tween.__proto__ = WickTween.prototype;
            });
        }

        obj.getAllChildObjects().forEach(function(currObj) {
            WickObject.addPrototypes(currObj);
        });
    }
}

/* Encodes scripts and strings to avoid JSON format problems */
WickObject.prototype.encodeStrings = function () {

    var encodeString = function (str) {
        var newStr = str;
        newStr = encodeURI(str);
        newStr = newStr.replace(/'/g, "%27");
        return newStr;
    }

    if(this.wickScripts) {
        for (var key in this.wickScripts) {
            this.wickScripts[key] = encodeString(this.wickScripts[key]);
        }
    }

    if(this.fontData) {
        this.fontData.text = encodeString(this.fontData.text);
    }

    if(this.svgData) {
        this.svgData.svgString = encodeString(this.svgData.svgString);
    }

    if(this.isSymbol) {
        this.getAllChildObjects().forEach(function(child) {
            child.encodeStrings();
        });
    }

}

/* Decodes scripts and strings back to human-readble and eval()-able format */
WickObject.prototype.decodeStrings = function () {
    
    var decodeString = function (str) {
        var newStr = str;
        newStr = newStr.replace(/%27/g, "'");
        newStr = decodeURI(str);
        return newStr;
    }
    
    if(this.wickScripts) {
        for (var key in this.wickScripts) {
            this.wickScripts[key] = decodeString(this.wickScripts[key])
        }
    }

    if(this.fontData) {
        this.fontData.text = decodeString(this.fontData.text);
    }

    if(this.svgData) {
        this.svgData.svgString = decodeString(this.svgData.svgString);
    }

    if(this.isSymbol) {
        this.getAllChildObjects().forEach(function(child) {
            child.decodeStrings();
        });
    }

}

WickObject.prototype.generateParentObjectReferences = function() {

    var parentObject = this;

    if(this.isSymbol) {

        // Recursively regenerate parent object references of all objects inside this symbol.
        this.getAllChildObjects().forEach(function(child) {
            child.parentObject = parentObject;
            child.generateParentObjectReferences();
        });
    }

}

WickObject.prototype.generateObjectNameReferences = function () {

    var that = this;

    this.getAllChildObjects().forEach(function(child) {
        that[child.name] = child;

        if(child.isSymbol) {
            child.generateObjectNameReferences();
        }
    });

}

// Used so that if the renderer can't render SVGs it has an image to fallback to
WickObject.prototype.generateSVGCacheImages = function (callback) {

    var that = this;

    if(this.svgData) {

        fabric.loadSVGFromString(this.svgData.svgString, function(objects, options) {
            objects[0].fill = that.svgData.fillColor;
            var svgFabricObject = fabric.util.groupSVGElements(objects, options);
            svgFabricObject.scaleX /= window.devicePixelRatio;
            svgFabricObject.scaleY /= window.devicePixelRatio;
            svgFabricObject.setCoords();
            svgFabricObject.cloneAsImage(function(clone) {
                var element = clone.getElement();
                var imgSrc = element.src;
                that.svgCacheImageData = imgSrc;
                callback();
            }, {enableRetinaScaling:false});
        });

    } else if(this.isSymbol) {

        var childrenConverted = 0;
        var nChildren = that.getTotalNumChildren();

        if(nChildren == 0) {
            callback();
        }

        this.getAllChildObjects().forEach(function(currObj) {
            currObj.generateSVGCacheImages(function () {
                childrenConverted++;
                if(childrenConverted == nChildren) {
                    callback();
                }
            });
        });
    } else {
        callback();
    }

}

/* Generate alpha mask for per-pixel hit detection */
WickObject.prototype.generateAlphaMask = function () {

    var that = this;

    var alphaMaskSrc = that.imageData || that.svgCacheImageData;
    if(!alphaMaskSrc) return;

    var image = new Image();
    image.onload = function () {
        var canvas = document.createElement('canvas');
        var w = Math.floor(that.width);
        var h = Math.floor(that.height);
        canvas.height = h;
        canvas.width = w;
        var ctx = canvas.getContext('2d');
        ctx.drawImage( image, 0, 0, w, h );
        var imgdata = ctx.getImageData(0,0,w,h);
        var rgba = imgdata.data;

        that.alphaMask = [];
        for (var y = 0; y < h; y ++) {
            for (var x = 0; x < w; x ++) {
                var alphaMaskIndex = x+y*w;
                //console.log(alphaMaskIndex)
                that.alphaMask[alphaMaskIndex] = rgba[alphaMaskIndex*4+3] === 0;
            }
        }

    }
    image.src = alphaMaskSrc;

}

/*************************
     Tween stuff
*************************/

WickObject.prototype.addTween = function (tween) {
    this.tweens.push(tween);
}

WickObject.prototype.hasTweenAtFrame = function (frame) {
    var foundTween = false
    this.tweens.forEach(function (tween) {
        if(foundTween) return;
        if(tween.frame === frame) foundTween = true;
    })
    return foundTween;
}

WickObject.prototype.getFromTween = function () {
    var foundTween = null;

    var relativePlayheadPosition = this.parentObject.getRelativePlayheadPosition(this);

    var seekPlayheadPosition = relativePlayheadPosition;
    while (!foundTween && seekPlayheadPosition >= 0) {
        this.tweens.forEach(function (tween) {
            if(tween.frame === seekPlayheadPosition) {
                foundTween = tween;
            }
        });
        seekPlayheadPosition--;
    }

    return foundTween;
}

WickObject.prototype.getToTween = function () {
    var foundTween = null;

    var relativePlayheadPosition = this.parentObject.getRelativePlayheadPosition(this);

    var seekPlayheadPosition = relativePlayheadPosition;
    var parentFrameLength = this.parentObject.getFrameWithChild(this).frameLength;
    while (!foundTween && seekPlayheadPosition < parentFrameLength) {
        this.tweens.forEach(function (tween) {
            if(tween.frame === seekPlayheadPosition) {
                foundTween = tween;
            }
        });
        seekPlayheadPosition++;
    }

    return foundTween;
}   

WickObject.prototype.applyTweens = function () {

    var that = this;

    if(!this.tweens) this.tweens = []; // Rescue old projects created before tweens came out

    if (!this.isRoot && this.tweens.length > 0) {
        if(this.tweens.length === 1) {
            this.tweens[0].applyTweenToWickObject(that);
        } else {
            var tweenFrom = that.getFromTween();
            var tweenTo = that.getToTween();
            var interpFunc = eval("("+tweenFrom.interpFunc+")")
            var t = that.parentObject.getRelativePlayheadPosition(that, {normalized:true});
            var interpolatedTween = WickTween.interpolateTweens(tweenFrom, tweenTo, t, interpFunc);
            interpolatedTween.applyTweenToWickObject(that);
        }
    }

    if (!this.isSymbol) return;

    this.getAllChildObjects().forEach(function (child) {
        child.applyTweens();
    });

}

/*************************
     
*************************/

WickObject.prototype.isClickable = function () {
    var isClickable = false;

    this.wickScripts['onClick'].split("\n").forEach(function (line) {
        if(isClickable) return;
        line = line.trim();
        if(!line.startsWith("//") && line !== "") {
            isClickable = true;
        }
    });

    return isClickable;
}

WickObject.prototype.isPointInside = function(point, parentScaleX, parentScaleY) {

    var that = this;

    if(!parentScaleX) {
        parentScaleX = 1.0;
    }
    if(!parentScaleY) {
        parentScaleY = 1.0;
    }

    if(that.isSymbol) {

        var pointInsideSymbol = false;

        that.getAllActiveChildObjects().forEach(function (child) {
            var subPoint = {
                x : point.x - that.x,
                y : point.y - that.y
            };
            if(child.isPointInside(subPoint, that.scaleX, that.scaleY)) {
                pointInsideSymbol = true;
            }
        });

        return pointInsideSymbol;

    } else {

        var scaledObjX = that.x;
        var scaledObjY = that.y;
        var scaledObjWidth = that.width*that.scaleX*parentScaleX;
        var scaledObjHeight = that.height*that.scaleY*parentScaleY;

        if ( point.x >= scaledObjX && 
             point.y >= scaledObjY  &&
             point.x <= scaledObjX + scaledObjWidth && 
             point.y <= scaledObjY  + scaledObjHeight ) {

            if(!that.alphaMask) return true;

            var objectRelativePointX = (point.x - scaledObjX);
            var objectRelativePointY = (point.y - scaledObjY);
            var objectAlphaMaskIndex = (Math.floor(objectRelativePointX)%Math.floor(that.width))+(Math.floor(objectRelativePointY)*Math.floor(that.width));
            return !that.alphaMask[(objectAlphaMaskIndex)];

        }

        return false;

    }
}

/*************************
     Scripting methods
*************************/

WickObject.prototype.update = function () {

    if(this.onNewFrame) {
        if(this.isSymbol && this.getCurrentFrame() && !this.getCurrentFrame().autoplay) {
            this.isPlaying = false;
        }

        this.onNewFrame = false;
    }

    if(this.justEnteredFrame) {

        this.runScript('onLoad');
        
        if(audioContext && this.audioBuffer && this.autoplaySound) {
            this.playSound();
        }

        this.justEnteredFrame = false;
    }

    this.runScript('onUpdate');

    if(this.isSymbol) {
        this.advanceTimeline();

        this.getAllActiveChildObjects().forEach(function(child) {
            child.update();
        });
    }

    this.readyToAdvance = true;

}

WickObject.prototype.runScript = function (scriptType) {

    var that = this;

    var script = this.wickScripts[scriptType];

    // Setup wickobject reference variables
    var project = WickPlayer.getProject() || wickEditor.project;
    var root = project.rootObject;
    var parent = this.parentObject;
    var mouse = WickPlayer.getMouse();
    var keys = WickPlayer.getKeys();
    var key = WickPlayer.getLastKeyPressed();

    // Setup builtin wick scripting methods and objects
    var play          = function ()      { that.parentObject.play(); }
    var stop          = function ()      { that.parentObject.stop(); }
    var gotoAndPlay   = function (frame) { that.parentObject.gotoAndPlay(frame); }
    var gotoAndStop   = function (frame) { that.parentObject.gotoAndStop(frame); }
    var gotoNextFrame = function ()      { that.parentObject.gotoNextFrame(); }
    var gotoPrevFrame = function ()      { that.parentObject.gotoPrevFrame(); }

    // stop all sounds wrapper
    var stopAllSounds = function () { WickPlayer.getAudioPlayer().stopAllSounds(); };

    // Clone wrapper
    this.clone = function () { return WickPlayer.cloneObject(this); };

    // Setup keycode shortcuts
    var isKeyDown = function (keyString) { return keys[keyCharToCode[keyString]]; };

    // WickObjects in same frame (scope) are accessable without using root./parent.
    if(!this.isRoot) {
        this.parentObject.getAllChildObjects().forEach(function(child) {
            if(child.name) window[child.name] = child;
        });
    }

    // Shortcut for editing text
    var text;
    if(this.pixiText) this.text = this.pixiText.text;
    
    // Run da script!!
    try {
        //eval(script);
        eval("try{" + script + "\n}catch (e) { throw (e); }");
    } catch (e) {
        if (window.wickEditor) {
            if(!wickEditor.interfaces.builtinplayer.running) return;

            console.error("Exception thrown while running script of WickObject with ID " + this.id);
            console.error(e);
            var lineNumber = null;
            if(e.stack) {
                e.stack.split('\n').forEach(function (line) {
                    if(lineNumber) return;
                    if(!line.includes("<anonymous>:")) return;

                    lineNumber = parseInt(line.split("<anonymous>:")[1].split(":")[0]);
                });
            }

            //console.log(e.stack.split("\n")[1].split('<anonymous>:')[1].split(":")[0]);
            //console.log(e.stack.split("\n"))
            wickEditor.interfaces.scriptingide.showError(this.id, scriptType, lineNumber, e);
        } else {
            alert("An exception was thrown while running a WickObject script. See console!");
            console.log(e);
        }
    }
    //eval("try{" + script + "}catch (e) { console.log(e); }");

    // Shortcut for text
    if(this.pixiText) this.pixiText.text = this.text;

    // Get rid of wickobject reference variables
    if(!this.isRoot) {
        this.parentObject.getAllChildObjects().forEach(function(child) {
            if(child.name) window[child.name] = undefined;
        });
    }

}

WickObject.prototype.advanceTimeline = function () { 
    // Advance timeline for this object
    if(this.isPlaying && this.readyToAdvance) {

        var oldFrame = this.getCurrentFrame();
        this.playheadPosition ++;

        // If we reached the end, go back to the beginning 
        if(this.playheadPosition >= this.getTotalTimelineLength()) {
            this.playheadPosition = 0;
        }

        var newFrame = this.getCurrentFrame();

        if(oldFrame !== newFrame) {
            this.onNewFrame = true;
            this.getAllActiveChildObjects().forEach(function (child) {
                child.justEnteredFrame = true;
            });
        }
    }

}

WickObject.prototype.play = function () {

    if(!this.isSymbol) {
        throw "play() called on wickobject that isn't a symbol!";
        return;
    }

    this.isPlaying = true;
}

WickObject.prototype.stop = function () {

    if(!this.isSymbol) {
        throw "stop() called on wickobject that isn't a symbol!";
        return;
    }

    this.isPlaying = false;
}

WickObject.prototype.gotoFrame = function (frame) {
    if (CheckInput.isNonNegativeInteger(frame)) {

        // Only navigate to an integer frame if it is nonnegative and a valid frame
        if(frame < this.getCurrentLayer().frames.length) {
            this.playheadPosition = frame;
        } else {
            throw (new Error("Failed to navigate to frame \'" + frame + "\': is not a valid frame."));
        }

    } else if (CheckInput.isString(frame)) {

        // Search for the frame with the correct identifier and navigate if found
        var newFrame = this.getFrameByIdentifier(frame);

        if(newFrame)
            this.playheadPosition = this.getPlayheadPositionAtFrame(newFrame);
        else
            throw "Failed to navigate to frame \'" + frame + "\': is not a valid frame.";

    } else {

        throw "Failed to navigate to frame \'" + frame + "\': is neither a string nor a nonnegative integer";

    }
}

WickObject.prototype.gotoAndPlay = function (frame) {

    if(!this.isSymbol) {
        throw "gotoAndPlay() called on wickobject that isn't a symbol!";
        return;
    }

    this.gotoFrame(frame);
    this.isPlaying = true;
    
}

WickObject.prototype.gotoAndStop = function (frame) {

    if(!this.isSymbol) {
        throw "gotoAndStop() called on wickobject that isn't a symbol!";
        return;
    }
    
    this.gotoFrame(frame);
    this.isPlaying = false;

}

WickObject.prototype.gotoNextFrame = function () {

    if(!this.isSymbol) {
        throw "gotoNextFrame() called on wickobject that isn't a symbol!";
        return;
    }

    this.playheadPosition ++;
    var totalLength = this.layers[this.currentLayer.getTotalLength];
    if(this.playheadPosition >= totalLength) {
        this.playheadPosition = totalLength-1;
    }

}

WickObject.prototype.gotoPrevFrame = function () {

    if(!this.isSymbol) {
        throw "gotoPrevFrame() called on wickobject that isn't a symbol!";
        return;
    }

    this.playheadPosition --;
    if(this.playheadPosition < 0) {
        this.playheadPosition = 0;
    }
}

/* Determine if two wick objects collide using rectangular hit detection on their
       farthest border */ 
WickObject.prototype.hitTestRectangles = function (otherObj) {
    var objA = this;
    var objB = otherObj;

    var objAAbsPos = objA.getAbsolutePosition();
    var objBAbsPos = objB.getAbsolutePosition();

    var objAWidth = objA.width * objA.scaleX;
    var objAHeight = objAHeight * objA.scaleY; 

    var objBWidth = objB.width * objB.scaleX; 
    var objBHeight = objB.height * objB.scaleY; 

    var left = objAAbsPos.x < (objBAbsPos.x + objBWidth); 
    var right = (objAAbsPos.x + objAWidth) > objBAbsPos.x; 
    var top = objAAbsPos.y < (objBAbsPos.y + objBHeight); 
    var bottom = (objAAbsPos.y + objA.height) > objBAbsPos.y; 

    return left && right && top && bottom;
}

/* Determine if two wickObjects Collide using circular hit detection from their
   centroid using their full width and height. */ 
WickObject.prototype.hitTestCircles = function (otherObj) {
    var objA = this;
    var objB = otherObj;
    
    var objAAbsPos = objA.getAbsolutePosition();
    var objBAbsPos = objB.getAbsolutePosition();

    var dx = objAAbsPos.x - objBAbsPos.x; 
    var dy = objAAbsPos.y - objBAbsPos.y;

    var objAWidth = objA.width * objA.scaleX;
    var objAHeight = objAHeight * objA.scaleY; 

    var distance = Math.sqrt(dx * dx + dy * dy);

    if (distance < ((objAWidth/2) + (objBWidth/2))) {
        return true;
    }

    return false; 
}

/* Returns a boolean alerting whether or not this object or any of it's children in frame, 
   have collided with the given object or any of it's children in frame. */
WickObject.prototype.hitTest = function (otherObj, hitTestType) {
    if (otherObj === undefined) {
        return false;
    }

    // Generate lists of all children of both objects

    var otherObjChildren = otherObj.getAllActiveChildObjects();
    if(!otherObj.isSymbol) {
        otherObjChildren.push(otherObj);
    }

    var thisObjChildren = this.getAllActiveChildObjects();
    if(!this.isSymbol) {
        thisObjChildren.push(this); 
    }

    // Load the collision detection function for the type of collision we want to check for

    var checkMethod;
    var hitTestMethods = {
        "rectangles" : "hitTestRectangles",
        "circles" : "hitTestCircles"
    }
    if(!hitTestType) {
        // Use default (rectangular hittest) if no hitTestType is provided
        checkMethod = hitTestMethods["rectangles"];
    } else {
        checkMethod = hitTestMethods[hitTestType];
        if(!checkMethod) {
            throw "Invalid hitTest collision type: " + hitTestType;
        }
    }

    // Ready to go! Check for collisions!!

    for (var i = 0; i < otherObjChildren.length; i++) {
        for (var j = 0; j < thisObjChildren.length; j++) {
            if (thisObjChildren[j][checkMethod](otherObjChildren[i])) {
                return true; 
            }
        }
    }

    return false; 

}

WickObject.prototype.copy = function () {

    var copiedObject = new WickObject();

    this.name = undefined; // ???? SHould we generate a name based on the object being copied?

    copiedObject.x = this.x;
    copiedObject.y = this.y;
    copiedObject.width = this.width;
    copiedObject.height = this.height;
    copiedObject.scaleX = this.scaleX;
    copiedObject.scaleY = this.scaleY;
    copiedObject.angle = this.angle;
    copiedObject.flipX = this.flipX;
    copiedObject.flipY = this.flipY;
    copiedObject.opacity = this.opacity;

    //copiedObject.tweens = ; // TODO: Copy tweens!!!

    copiedObject.wickScripts = {};
    copiedObject.wickScripts.onLoad = this.wickScripts.onLoad;
    copiedObject.wickScripts.onClick = this.wickScripts.onClick;
    copiedObject.wickScripts.onUpdate = this.wickScripts.onUpdate;
    copiedObject.wickScripts.onKeyDown = this.wickScripts.onKeyDown;

    if(this.isSymbol) {
        copiedObject.isSymbol = true;

        copiedObject.playheadPosition = 0;
        copiedObject.currentLayer = 0;

        this.layers.forEach(function (layer) {
            copiedObject.layers.push(layer.copy());
        })
    } else {
        copiedObject.isSymbol = false;

        copiedObject.imageData = this.imageData;
        copiedObject.fontData = this.fontData;
        copiedObject.svgData = this.svgData;
    }

    return copiedObject;

}

/*****************************
 *      Object Movement      *
 *****************************/

WickObject.prototype.moveUp = function(delta) {
    if (delta === undefined) {
        delta = 1; 
    }

    if (typeof delta != "number") {
        WickError.error("Invalid Input: moveUp() can only take numbers!");
    }

    this.y -= delta; 
}

WickObject.prototype.moveDown = function(delta) {
    if (delta === undefined) {
        delta = 1; 
    }

    if (typeof delta != "number") {
        WickError.error("Invalid Input: moveDown() can only take numbers!");

}

WickObject.prototype.moveLeft = function(delta) {

WickObject.prototype.rotateCW = function(theta) {
    if (theta === undefined) {
        theta = 1;
    }

    if (typeof theta != "number") {
        WickError.error("Invalid Input: rotateCW() can only take numbers!");
    }

}

WickObject.prototype.rotateCCW = function(theta) {
    if (theta === undefined) {
        theta = 1;
    }

    if (typeof theta != "number") {
        WickError.error("Invalid Input: rotateCCW() can only take numbers!");

WickObject.prototype.scale = function(scaleFactor) {
    if (scaleFactor === undefined) {
        scaleFactor = 1; 
    }

    if (typeof scaleFactor != "number") {
        WickError.error("Invalid Input: scale() can only take numbers!");
    }

    this.scaleX = scaleFactor; 
    this.scaleY = scaleFactor; 
}

WickObject.prototype.scaleWidth = function(scaleFactor) {
    if (scaleFactor === undefined) {
        scaleFactor = 1; 
    }

    if (typeof scaleFactor != "number") {
        WickError.error("Invalid Input: scaleWidth() can only take numbers!");
    }

    this.scaleX = scaleFactor; 
}

WickObject.prototype.scaleHeight = function(scaleFactor) {
    if (scaleFactor === undefined) {
        scaleFactor = 1; 
    }

    if (typeof scaleFactor != "number") {
        WickError.error("Invalid Input: scaleHeight() can only take numbers!");

    this.scaleY = scaleFactor;

WickObject.prototype.flipHorizontal = function() {
    this.flipX = !this.flipX; 
}

WickObject.prototype.flipVertical = function() {

WickObject.prototype.setOpacity = function(opacityVal) {
    if (typeof opacityVal != "number") {

    }

    this.opacity = Math.min(Math.max(opacityVal, 0), 1);

<script>/* Wick - (c) 2016 Zach Rispoli, Luca Damasco, and Josh Rispoli */

var WickProject = function () {

    // Create the root object. The editor is always editing the root 
    // object or its sub-objects and cannot ever leave the root object.
    this.createNewRootObject();

    // Only used by the editor. Keeps track of current object editor is editing.
    this.currentObjectID = this.rootObject.id;
    this.rootObject.currentFrame = 0;

    this.onionSkinning = false;
    
    this.resolution = {};
    this.resolution.x = 720;
    this.resolution.y = 480;

    this.backgroundColor = "#FFFFFF";

    this.framerate = 12;

    this.fitScreen = false;
    this.borderColor = "#FFFFFF";

    this.renderer = "WickPixiRenderer";
    this.audioPlayer = "WickWebAudioPlayer";

};

WickProject.prototype.createNewRootObject = function () {
    var rootObject = new WickObject();
    rootObject.id = 0;
    rootObject.isSymbol = true;
    rootObject.isRoot = true;
    rootObject.playheadPosition = 0;
    rootObject.currentLayer = 0;
    rootObject.layers = [new WickLayer()];
    rootObject.x = 0;
    rootObject.y = 0;
    rootObject.opacity = 1.0;
    this.rootObject = rootObject;
}

/*****************************
    Import/Export
*****************************/

WickProject.fromFile = function (file, callback) {

    var reader = new FileReader();
    reader.onload = function(e) {
        if (file.type === "text/html") {
            callback(WickProject.fromWebpage(e.target.result));
        } else if (file.type === "application/json") {
            callback(WickProject.fromJSON(e.target.result));
        }
    };
    reader.readAsText(file);

}

WickProject.fromWebpage = function (webpageString) {

    var extractedProjectJSON;

    var webpageStringLines = webpageString.split('\n');
    webpageStringLines.forEach(function (line) {
        if(line.startsWith("<script>WickPlayer.runProject(")) {
            extractedProjectJSON = line.split("'")[1];
        }
    });

    if(!extractedProjectJSON) {
        // Oh no, something went wrong
        console.error("Bundled JSON project not found in specified HTML file (webpageString). The HTML supplied might not be a Wick project, or zach might have changed the way projects are bundled. See WickProjectExporter.js!");
        return null;
    } else {
        // Found a bundled project's JSON, let's load it!
        return WickProject.fromJSON(extractedProjectJSON);
    }
}

WickProject.fromJSON = function (rawJSONProject) {

    var JSONString = WickProjectCompressor.decompressProject(rawJSONProject);

    // Replace current project with project in JSON
    var projectFromJSON = JSON.parse(JSONString);

    // Put prototypes back on object ('class methods'), they don't get JSONified on project export.
    projectFromJSON.__proto__ = WickProject.prototype;
    WickObject.addPrototypes(projectFromJSON.rootObject);

    // Decode scripts back to human-readble and eval()-able format
    projectFromJSON.rootObject.decodeStrings();

    projectFromJSON.rootObject.generateParentObjectReferences();

    return projectFromJSON;
}

WickProject.fromLocalStorage = function () {

    if(!localStorage) {
        console.error("LocalStorage not available. Loading blank project");
        return new WickProject();
    }
    
    var autosavedProjectJSON = localStorage.getItem('wickProject');

    if(!autosavedProjectJSON) {
        console.log("No autosaved project. Loading blank project.");
        return new WickProject();
    }

    console.log("Loading project from local storage...");
    return WickProject.fromJSON(autosavedProjectJSON);

}

WickProject.prototype.getAsJSON = function (callback, args) {

    console.log("Generating project JSON...");

    // Rasterize SVGs
    var that = this;
    this.rootObject.generateSVGCacheImages(function () {
        // Encode scripts/text to avoid JSON format problems
        that.rootObject.encodeStrings();
        
        var JSONProject = JSON.stringify(that, WickProjectExporter.JSONReplacer);
        
        // Decode scripts back to human-readble and eval()-able format
        that.rootObject.decodeStrings();

        console.log("Done!");

        callback(JSONProject)
    });

}

WickProject.prototype.saveInLocalStorage = function () {
    this.getAsJSON(function (JSONProject) {
        var compressedJSONProject = WickProjectCompressor.compressProject(JSONProject, "LZSTRING-UTF16");
        WickProject.saveProjectJSONInLocalStorage(compressedJSONProject);
    });
}

WickProject.saveProjectJSONInLocalStorage = function (projectJSON) {
    if(localStorage) {
        try {
            localStorage.setItem('wickProject', projectJSON);
            console.log("Project saved to local storage.");
        } catch (err) {
            console.error("LocalStorage could not save project, threw error:");
            console.log(err);
        }
    } else {
        console.error("LocalStorage not available.")
    }
}

/*********************************
    Access project wickobjects
*********************************/

WickProject.prototype.regenerateUniqueIDs = function (wickObject) {
    var that = this;

    if(!wickObject.id && wickObject.id!=0) {
        //wickObject.id = this.rootObject.getLargestID() + 1; // Currently broken
        // This is silly, but the actionhandler freaks out if it has to add an object 
        // right after deleting another (those objects would have the same id.) (pls fix)
        wickObject.id = new Date().getTime() + this.rootObject.getLargestID();
    }

    if(wickObject.isSymbol) {
        wickObject.getAllChildObjects().forEach(function (child) {
            that.regenerateUniqueIDs(child);
        });
    }
}

WickProject.prototype.addObject = function (wickObject, zIndex) {

    var frame = this.getCurrentObject().getCurrentFrame();
    if(zIndex === undefined) {
        frame.wickObjects.push(wickObject);
    } else {
        frame.wickObjects.splice(zIndex, 0, wickObject);
    }

    this.regenerateUniqueIDs(this.rootObject);

}

WickProject.prototype.getObjectByID = function (id) {

    return this.rootObject.getChildByID(id);

}

WickProject.prototype.getCurrentObject = function () {

    return this.getObjectByID(this.currentObjectID);

}

WickProject.prototype.jumpToObject = function (id) {

    var that = this;

    this.rootObject.getAllChildObjectsRecursive().forEach(function (child) {
        if(child.id === id) {
            that.currentObjectID = child.parentObject.id;
        }
    });

    var currentObject = this.getCurrentObject();
    var frameWithChild = currentObject.getFrameWithChild(this.rootObject.getChildByID(id));
    var playheadPositionWithChild = currentObject.getPlayheadPositionAtFrame(frameWithChild);
    currentObject.playheadPosition = playheadPositionWithChild;

}

WickProject.prototype.hasSyntaxErrors = function () {

    var projectHasSyntaxErrors = false;

    this.rootObject.getAllChildObjectsRecursive().forEach(function (child) {
        if(child.hasSyntaxErrors) {
            projectHasSyntaxErrors = true;
        }
    }); 

    return projectHasSyntaxErrors;

}

</script>
<script>/* Wick - (c) 2016 Zach Rispoli, Luca Damasco, and Josh Rispoli */

var rendererContainerEl;
var renderer;
var stage;

var projectFitScreenScale;
var projectFitScreenTranslate;

var WickPixiRenderer = function (project) {

	this.refreshPixiSceneForObject = function (wickObj) {
		//generatePixiScene(wickObj);
		if (wickObj.imageData || wickObj.svgCacheImageData) {
            wickObj.pixiSprite = PIXI.Sprite.fromImage(wickObj.imageData || wickObj.svgCacheImageData);
            wickObj.parentObject.pixiContainer.addChild(wickObj.pixiSprite);
        } else if (wickObj.fontData) {
            var style = {
                font : "normal " + wickObj.fontData.fontSize + "px " + wickObj.fontData.fontFamily,
                fill : wickObj.fontData.fill,
                wordWrap : false,
                wordWrapWidth : 440
            };
            wickObj.pixiText = new PIXI.Text(wickObj.fontData.text, style);
            wickObj.setText = function (text) { wickObj.pixiText.setText(text); };
            wickObj.parentObject.pixiContainer.addChild(wickObj.pixiText);
        }
	}

	/* Recursively load images of wickObj */
    var generatePixiScene = function (wickObj) {

        wickObj.pixiContainer = new PIXI.Container();

        wickObj.getAllChildObjects().forEach(function(subObj) {
            if (subObj.isSymbol) {
                generatePixiScene(subObj);
                wickObj.pixiContainer.addChild(subObj.pixiContainer);
            } else if (subObj.imageData || subObj.svgCacheImageData) {
                subObj.pixiSprite = PIXI.Sprite.fromImage(subObj.imageData || subObj.svgCacheImageData);
                wickObj.pixiContainer.addChild(subObj.pixiSprite);
            } else if (subObj.fontData) {
                var style = {
                    font : "normal " + subObj.fontData.fontSize + "px " + subObj.fontData.fontFamily,
                    fill : subObj.fontData.fill,
                    wordWrap : true,
                    wordWrapWidth : 1440
                };
                subObj.pixiText = new PIXI.Text(subObj.fontData.text, style);
                subObj.setText = function (text) { subObj.pixiText.setText(text); };
                wickObj.pixiContainer.addChild(subObj.pixiText);
            }
        });
    }

    var resizeCanvas = function () {

	    if(project && project.fitScreen) {
	        // Calculate how much the project would have to scale to fit either dimension
	        widthRatio  = window.innerWidth  / project.resolution.x;
	        heightRatio = window.innerHeight / project.resolution.y;

	        // Fit only so much that stuff doesn't get cut off
	        if(widthRatio > heightRatio) {
	            projectFitScreenScale = heightRatio;
	        } else {
	            projectFitScreenScale = widthRatio;
	        }

	        renderer.view.style.width  = project.resolution.x * projectFitScreenScale + "px";
	        renderer.view.style.height = project.resolution.y * projectFitScreenScale + "px";

	        if(widthRatio > heightRatio) {
	            var offset = (window.innerWidth - project.resolution.x * projectFitScreenScale) / 2;
	            rendererContainerEl.style.paddingLeft = offset + "px";
	            rendererContainerEl.style.paddingTop  = "0px";
	        } else {
	            var offset = (window.innerHeight - project.resolution.y * projectFitScreenScale) / 2;
	            rendererContainerEl.style.paddingLeft = "0px";
	            rendererContainerEl.style.paddingTop  = offset + "px";
	        }
	    } else {
	        renderer.view.style.width  = project.resolution.x + "px";
	        renderer.view.style.height = project.resolution.y + "px";

	        var offsetX = (window.innerWidth  - project.resolution.x) / 2;
	        var offsetY = (window.innerHeight - project.resolution.y) / 2;

	        rendererContainerEl.style.paddingLeft   = offsetX + "px";
	        rendererContainerEl.style.paddingRight  = offsetX + "px";
	        rendererContainerEl.style.paddingTop    = offsetY + "px";
	        rendererContainerEl.style.paddingBottom = offsetY + "px";
	    }

	}

	this.setup = function() {

		// update canvas size on window resize
        window.addEventListener('resize', resizeCanvas, false);

	    rendererContainerEl = document.getElementById("playerCanvasContainer");
	    var rendererOptions = {
	        backgroundColor : "#DDDDDD", 
	        resolution: window.devicePixelRatio };
	    renderer = PIXI.autoDetectRenderer(project.resolution.x, project.resolution.y, rendererOptions);
	    renderer.clearBeforeRender = false;

	    // Get rid of old canvas (if it exists)
	    var oldRendererCanvas = document.getElementById("rendererCanvas");
	    if(oldRendererCanvas) {
	        rendererContainerEl.removeChild(rendererContainerEl.childNodes[0]);
	    }

	    // Add renderer canvas
	    rendererContainerEl.appendChild(renderer.view);
	    renderer.view.id = "rendererCanvas";
	    stage = new PIXI.Container();

	    projectFitScreenScale = 1.0;
	    projectFitScreenTranslate = {x : 0, y : 0};

	    resizeCanvas();

	    generatePixiScene(project.rootObject);

	}

	this.render = function() {

	    var graphics = new PIXI.Graphics();
	    graphics.beginFill(parseInt(project.backgroundColor.replace("#","0x")));
	    graphics.drawRect(0, 0, project.resolution.x, project.resolution.y);
	    graphics.endFill();
	    renderer.render(graphics);

	    resetAllPixiObjects(project.rootObject);
	    updatePixiObjectTransforms(project.rootObject);
	    renderer.render(project.rootObject.pixiContainer);
	}

	var resetAllPixiObjects = function (wickObj) {

	    wickObj.getAllChildObjects().forEach(function(subObj) {
	        if(subObj.pixiSprite) {
	            subObj.pixiSprite.visible = false;
	        }
	        if(subObj.pixiText) {
	            subObj.pixiText.visible = false;
	        }
	        if(subObj.pixiContainer) {
	            subObj.pixiContainer.visible = false;
	        }

	        if(subObj.isSymbol) {
	            resetAllPixiObjects(subObj);
	        }
	    });

	}

	var updatePixiObjectTransforms = function (wickObj) {

	    if(wickObj.isSymbol) {
	        wickObj.pixiContainer.visible = true;
	        if(!wickObj.isRoot) {
	            wickObj.pixiContainer.anchor = new PIXI.Point(0.0, 0.0);
	            wickObj.pixiContainer.position.x = Math.round(wickObj.x)// + wickObj.width/2  * wickObj.scaleX;
	            wickObj.pixiContainer.position.y = Math.round(wickObj.y)// + wickObj.height/2 * wickObj.scaleY;
	            wickObj.pixiContainer.rotation = wickObj.angle/360*2*3.14159;
	            wickObj.pixiContainer.scale.x  = wickObj.scaleX;
	            wickObj.pixiContainer.scale.y  = wickObj.scaleY;
	            if(wickObj.flipX) { wickObj.pixiContainer.scale.x *= -1; wickObj.pixiContainer.position.x += wickObj.width*wickObj.scaleX }
	            if(wickObj.flipY) { wickObj.pixiContainer.scale.y *= -1; wickObj.pixiContainer.position.y += wickObj.height*wickObj.scaleY }
	            wickObj.pixiContainer.alpha    = wickObj.opacity;
	        }
	        wickObj.getAllActiveChildObjects().forEach(function(subObj) {
	            updatePixiObjectTransforms(subObj);
	        });
	    } else {
	        if(wickObj.pixiSprite) {
	            wickObj.pixiSprite.visible = true;
	            wickObj.pixiSprite.anchor = new PIXI.Point(0.0, 0.0);
	            wickObj.pixiSprite.position.x = Math.round(wickObj.x)// + wickObj.width /2*wickObj.scaleX;
	            wickObj.pixiSprite.position.y = Math.round(wickObj.y)// + wickObj.height/2*wickObj.scaleY;
	            wickObj.pixiSprite.rotation = wickObj.angle/360*2*3.14159;
	            wickObj.pixiSprite.scale.x  = wickObj.scaleX// / window.devicePixelRatio;
	            wickObj.pixiSprite.scale.y  = wickObj.scaleY// / window.devicePixelRatio;
	            //if(wickObj.flipX) wickObj.pixiSprite.scale.x *= -1;
	            //if(wickObj.flipY) wickObj.pixiSprite.scale.y *= -1;
	            if(wickObj.flipX) { wickObj.pixiSprite.scale.x *= -1; wickObj.pixiSprite.position.x += wickObj.width*wickObj.scaleX }
	            if(wickObj.flipY) { wickObj.pixiSprite.scale.y *= -1; wickObj.pixiSprite.position.y += wickObj.height*wickObj.scaleY }
	            wickObj.pixiSprite.alpha    = wickObj.opacity;
	        } else if(wickObj.pixiText) {
	            wickObj.pixiText.visible = true;
	            //wickObj.pixiText.anchor = new PIXI.Point(0.5, 0.5);
	            wickObj.pixiText.x        = Math.round(wickObj.x);
	            wickObj.pixiText.y        = Math.round(wickObj.y);
	            wickObj.pixiText.rotation = wickObj.angle/360*2*3.14159;
	            wickObj.pixiText.scale.x  = wickObj.scaleX;
	            wickObj.pixiText.scale.y  = wickObj.scaleY;
	            if(wickObj.flipX) wickObj.pixiText.scale.x *= -1;
	            if(wickObj.flipY) wickObj.pixiText.scale.y *= -1;
	            wickObj.pixiText.alpha    = wickObj.opacity;
	        }
	    }

	}

	this.cleanup = function() {
		window.removeEventListener('resize', resizeCanvas);

	}
};</script>
<script>/* Wick - (c) 2016 Zach Rispoli, Luca Damasco, and Josh Rispoli */

var audioContext = null;
    var readyToStartWebAudioContext;

var WickWebAudioPlayer = function (project) {
    var that = this; 

    this.loadAudio = function(wickObj) {

        if(!audioContext) return;

        if(wickObj.audioData) {
            var rawData = wickObj.audioData.split(",")[1]; // cut off extra filetype/etc data
            var rawBuffer = Base64ArrayBuffer.decode(rawData);
            //wickObj.audioBuffer = rawBuffer;
            audioContext.decodeAudioData(rawBuffer, function (buffer) {
                if (!buffer) {
                    console.error("failed to decode:", "buffer null");
                    return;
                }
                wickObj.audioBuffer = buffer
                wickObj.playSound = function (volume) {
                    var actualVolume = volume;
                    if(!volume) actualVolume = 1.0;
                    that.playSound(wickObj.id, wickObj.audioBuffer, wickObj.loopSound, actualVolume);
                }
                wickObj.stopSound = function () {
                    that.stopSound(wickObj.id);
                }
            }, function (error) {
                console.error("failed to decode:", error);
            });
        }

        if(wickObj.isSymbol) {
            wickObj.getAllChildObjects().forEach(function(subObj) {
                that.loadAudio(subObj);
            });
        }
    }

    this.setup = function() {
        
        var AudioContext = window.AudioContext // Default
                        || window.webkitAudioContext // Safari and old versions of Chrome
                        || false;

        if(!AudioContext) {
            console.log("WebAudio not supported! Sounds will not play.");
            return;
        }

        audioContext = new AudioContext();

        // Setup dummy node and discard it to get webaudio context running
        if(audioContext.createGainNode) {
            audioContext.createGainNode();
        } else {
            audioContext.createGain();
        }

        //if(!mobileMode) {
            //loadAudio(project.rootObject);
        //}

        this.loadAudio(project.rootObject)

    }

    this.update = function() {
        if(!audioContext) return
    }

    var allPlayingSounds = [];

    this.playSound = function (wickObjID, buffer, loop, volume) {
        if(!audioContext) return;

        if(!project.muted) {
            var gainNode = audioContext.createGain();
            var source = audioContext.createBufferSource();
            source.buffer = buffer;
            source.connect(audioContext.destination);
            source.connect(gainNode);
            gainNode.connect(audioContext.destination);
            gainNode.gain.value = volume;
            source.loop = loop;
            source.start(0);
            allPlayingSounds.push({source:source, id:wickObjID});
            console.log("started...");
        }
    }

    this.stopSound = function (wickObjID) {
        allPlayingSounds.forEach(function (sound) {
            if(sound.id === wickObjID) {
                sound.source.stop();
            }
        });
    }

    this.stopAllSounds = function () {
        allPlayingSounds.forEach(function (sound) {
            sound.source.stop();
        });
    }

    this.cleanup = function() {
        if(!audioContext) return

        audioContext.close();
    }

    
};




</script>
<script>/* Wick - (c) 2016 Zach Rispoli, Luca Damasco, and Josh Rispoli */

var WickPlayer = (function () {

    var wickPlayer = { };

    // Current project being played by player
    var project;

    // Input vars for mouse and keyboard
    var mouse = {x:0, y:0};
    var keys = [];
    var lastKeyPressed;

    // Renderer
    var renderer;
    var audioPlayer;

    // Flags for different player modes (phone or desktop)
    var mobileMode;
    var desktopMode;

    // Set this to true to stop the next requestAnimationFrame
    var stopDrawLoop;

/*****************************
    experimenting ........
*****************************/

    wickPlayer.cloneObject = function (wickObj) {
        var clone = wickObj.copy();

        // pixi stuff
        //renderer.refreshPixiSceneForObject(clone);
        //wickObj.parentObject.pixiContainer.addChild(clone.pixiContainer || clone.pixiSprite || clone.pixiText)

        // player stuff
        resetAllPlayheads(clone);
        resetAllEventStates(clone);

        clone.parentObject = project.rootObject;
        project.addObject(clone);
        renderer.refreshPixiSceneForObject(clone);

        //project.addObject(clone);
        //clone.parentObject = project.rootObject;
        //wickObj.parentObject.addChild
        //project.regenerateUniqueIDs(project.rootObject);

        return clone;
    }

    wickPlayer.getAudioPlayer = function () {
        return audioPlayer;
    }

    wickPlayer.getRenderer = function () {
        return renderer;
    }

/*****************************
    Player Setup
*****************************/

    wickPlayer.getMouse = function () {
        return mouse;
    }

    wickPlayer.getKeys = function () {
        return keys;
    }

    wickPlayer.getLastKeyPressed = function () {
        return lastKeyPressed;
    }

    wickPlayer.getProject = function () {
        return project;
    }

    wickPlayer.runProject = function(projectJSON) {

        stopDrawLoop = false;

        // Check if we're on a mobile device or not
        mobileMode = BrowserDetectionUtils.inMobileMode;
        desktopMode = !mobileMode;

        // Load the project!
        loadJSONProject(projectJSON);

        var allObjects = project.rootObject.getAllChildObjectsRecursive();
        allObjects.forEach(function (child) {
            child.generateAlphaMask();
        });

        if(!project.audioPlayer) project.audioPlayer = "WickWebAudioPlayer"; // Patch old projects
        if(!project.renderer) project.renderer = "WickPixiRenderer"; // Patch old projects
        renderer = new window[project.renderer](project);
        audioPlayer = new window[project.audioPlayer](project);

        if(!mobileMode) {
            audioPlayer.setup();
        }
        renderer.setup();
        var playerCanvasContainer = document.getElementById("playerCanvasContainer");

        animate();

        // Setup mouse and key events (desktop mode)
        mouse = { x : 0, y : 0 };
        keys = [];
        if(desktopMode) {
            playerCanvasContainer.addEventListener('mousemove', onMouseMove, false);
            playerCanvasContainer.addEventListener("mousedown", onMouseDown, false);

            document.addEventListener("keydown", handleKeyDownInput);
            document.addEventListener("keyup", handleKeyUpInput);
        }

        // Setup touch events (mobile mode)
        if(mobileMode) {
            // Touch event (one touch = like a mouse click)
            playerCanvasContainer.addEventListener("touchstart", onTouchStart, false);

            // Squash gesture events
            playerCanvasContainer.addEventListener('gesturestart',  function(e) { e.preventDefault(); });
            playerCanvasContainer.addEventListener('gesturechange', function(e) { e.preventDefault(); });
            playerCanvasContainer.addEventListener('gestureend',    function(e) { e.preventDefault(); });
        }

    }

    wickPlayer.stopRunningCurrentProject = function() {

        stopDrawLoop = true;

        rendererContainerEl.removeEventListener("mousedown", onMouseDown);
        rendererContainerEl.removeEventListener("touchstart", onTouchStart);

        document.removeEventListener("keydown", handleKeyDownInput);
        document.removeEventListener("keyup", handleKeyUpInput);

        audioPlayer.cleanup();
        renderer.cleanup();

    }

/*****************************
    Opening projects
*****************************/

    var loadJSONProject = function (proj) {
        // Parse dat project
        project = WickProject.fromJSON(proj)

        // Make sure we are always in the root (the player never 'goes inside' objects like the editor does.)
        project.currentObjectID = project.rootObject.id;
        project.rootObject.currentLayer = 0;

        console.log("Player loading project:")
        console.log(project);

        // Prepare all objects for being played/drawn
        resetAllPlayheads(project.rootObject);
        resetAllEventStates(project.rootObject);

        // Regenerate WickObject stuff that we lost when the projects was JSONified
        project.rootObject.generateObjectNameReferences(project.rootObject);
        project.rootObject.generateParentObjectReferences(project.rootObject);
    }

    /* Make sure all objects start at first frame and start playing */
    var resetAllPlayheads = function (wickObj) {

        // Set all playhead vars
        if(wickObj.isSymbol) {
            // Set this object to it's first frame
            wickObj.playheadPosition = 0;

            // Start the object playing
            wickObj.isPlaying = true;

            // Recursively set all playhead vars of children
            wickObj.getAllChildObjects().forEach(function(subObj) {
                resetAllPlayheads(subObj);
            });
        }
    }

    /* */
    var resetAllEventStates = function (wickObj) {

        // Reset the mouse hovered over state flag
        wickObj.hoveredOver = false;

        // All WickObjects are ready to play their sounds, run their onLoad scripts, etc.
        wickObj.justEnteredFrame = true;
        wickObj.onNewFrame = true;

        // Do the same for all this object's children
        if(wickObj.isSymbol) {
            wickObj.getAllChildObjects().forEach(function(subObj) {
                resetAllEventStates(subObj);
            });
        }

    }

/*****************************
    Desktop event functions
*****************************/

    var onMouseMove = function (evt) {

        mouse = getMousePos(document.getElementById("rendererCanvas"), evt);

        // Check if we're hovered over a clickable object...
        var hoveredOverObj = false;
        project.rootObject.getAllActiveChildObjects().forEach(function(child) {
            if(child.isPointInside(mouse) && child.isClickable()) {
                child.hoveredOver = true;
                hoveredOverObj = true;
            } else {
                child.hoveredOver = false;
            }
        });

        //...and change the cursor if we are
        if(hoveredOverObj) {
            rendererContainerEl.style.cursor = "pointer";
        } else {
            rendererContainerEl.style.cursor = "default";
        }

    }

    var onMouseDown = function (evt) {
        
        project.rootObject.getAllActiveChildObjects().forEach(function(child) {
            if(child.isPointInside(mouse) && child.isClickable) {
                child.runScript("onClick");
            }
        });

    }

    var handleKeyDownInput = function (event) {

        keys[event.keyCode] = true;
        lastKeyPressed = codeToKeyChar[event.keyCode];

        project.rootObject.getAllActiveChildObjects().forEach(function(child) {
            child.runScript("onKeyDown");
        });
    }

    var handleKeyUpInput = function (event) {
        keys[event.keyCode] = false;
    }

/*****************************
    Mobile event functions
*****************************/

    var onTouchStart = function (evt) {

        evt.preventDefault();

        // on iOS, WebAudio context only gets 'unmuted' after first user interaction
        if(!audioContext) {
            setupWebAudioContext();
            loadAudio(project.rootObject);
        }

        var touchPos = getTouchPos(renderer.view, evt);

        project.rootObject.getAllActiveChildObjects().forEach(function(child) {
            if(child.isPointInside(touchPos) && child.isClickable()) {
                child.runScript("onClick");
            }
        });

    }

/*****************************
    Page/DOM Utils
*****************************/

    var getMousePos = function (canvas, evt) {
        var canvasBoundingClientRect = canvas.getBoundingClientRect();

        var mouseX = evt.clientX;
        var mouseY = evt.clientY;

        if(project.fitScreen) {
            mouseX -= canvasBoundingClientRect.left;
            mouseY -= canvasBoundingClientRect.top;
        }

        mouseX -= projectFitScreenTranslate.x;
        mouseY -= projectFitScreenTranslate.y;

        mouseX /=  projectFitScreenScale;
        mouseY /=  projectFitScreenScale;

        var centeredCanvasOffsetX = (window.innerWidth - project.resolution.x) / 2;
        var centeredCanvasOffsetY = (window.innerHeight - project.resolution.y) / 2;

        if(!project.fitScreen) {
            mouseX -= centeredCanvasOffsetX;
            mouseY -= centeredCanvasOffsetY;
        }

        return {
            x: mouseX,
            y: mouseY
        };
    }

    var getTouchPos = function (canvas, evt) {
        var canvasBoundingClientRect = canvas.getBoundingClientRect();

        var touch = evt.targetTouches[0];

        var touchX = touch.pageX;
        var touchY = touch.pageY;

        if(project.fitScreen) {
            touchX -= canvasBoundingClientRect.left;
            touchY -= canvasBoundingClientRect.top;
        }

        touchX -= projectFitScreenTranslate.x;
        touchY -= projectFitScreenTranslate.y;

        touchX /=  projectFitScreenScale;
        touchY /=  projectFitScreenScale;

        var centeredCanvasOffsetX = (window.innerWidth - project.resolution.x) / 2;
        var centeredCanvasOffsetY = (window.innerHeight - project.resolution.y) / 2;

        if(!project.fitScreen) {
            touchX -= centeredCanvasOffsetX;
            touchY -= centeredCanvasOffsetY;
        }

        return {
            x: touchX,
            y: touchY
        };
    }

/*****************************
    Draw/update loop
*****************************/

    var animate = function () {

        if(project.framerate < 60) {
            setTimeout(function() {

                if(!stopDrawLoop) {
                    
                    project.rootObject.update();
                    renderer.render();
                    animate();
                    //requestAnimationFrame(animate);
                }
            }, 1000 / project.framerate);

        } else {

            if(!stopDrawLoop) {
                requestAnimationFrame(animate);
            }
            project.rootObject.update();
            renderer.render();

        }

    }

    return wickPlayer;
